import './App.css';
import { Greet } from './components/Greet.js'

function App() {
  return (
    <div className="App">
      <Greet name='Bruce' heroName='Batman'/>
      <Greet name='Clark' heroName='Superman'>
        <button>
          Action
        </button>
      </Greet>
      <Greet name='Diana'heroName='Wonderwoman'>
        <p>This is children props</p>
      </Greet>
    </div>
  );
}

export default App;
